import React from 'react';

class Signin extends React.Component{
  constructor(props)
  {
    super(props);
    this.state ={
      signInEmail:'',
      signInPassword:''
    }
  }

  onEmailChange=(event)=>{
    this.setState({signInEmail:event.targent.value});
  }

  onPasswordChange=(event)=>{
    this.setState({signInPassword:event.targent.value});
  }

  onSubmit=()=>{
    console.log(this.state);
    this.props.onRouteChange('home');
  }

  render()
  {
  const {onSubmit,onEmailChange,onPasswordChange}=this.props;
  return(
  <main className="pa4 black-80">
  <form className="measure center">
    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
      <legend className="f4 fw6 ph0 mh0">Sign In</legend>
      <div className="mt3">
        <label className="db fw6 lh-copy f6" for="email-address">Email</label>
        <input onChange={()=>onEmailChange} className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address"  id="email-address"/>
      </div>
      <div className="mv3">
        <label className="db fw6 lh-copy f6" for="password">Password</label>
        <input onChange={()=>onPasswordChange} className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password"/>
      </div>
    </fieldset>
    <div className="">
      <input onClick={() => onSubmit} className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" type="submit" value="Sign in"/>
    </div>
  </form>
</main>);
 }

}

export default Signin;
